import Layout from '../layout/layout';

function forgetPassword() {
  return (
    <Layout>
      <div className="row" >
          <div className="col-12">
            <input type="text" name="forgetPassword" />
          </div>
      </div>
    </Layout>
  );
}

export default forgetPassword;
